import { Link, Outlet } from "react-router-dom";

function Layout(){
    return(
        <div>
            <nav>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/">Favoritos</Link></li>
                <li><Link to="/">Contacto</Link></li>
            </nav>
            <Outlet/>
        </div>
    )
}
export default Layout;
